import React from 'react';
import { CustomButton } from '../../components/common/button/btn';

const TalkTab = () => {
    return (
        <div className='flex gap-2 items-center rounded bg-gray-100 dark:bg-dark-800  hover:shadow-white py-2 px-2'>
            <h3 className='text-gray-800 dark:text-gray-200  text-base'>let talk football</h3>
        <CustomButton className='bg-primary-800 text-sm '>Join</CustomButton>
        </div>
    );
};

export default TalkTab;
